import React, {Component} from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useParams
  } from "react-router-dom";



const Tags = (props) => {



    const Child = () => {
        let {id} = useParams();
        console.log(id)
        props.changeCurrentTag(id)
        return null;
    }

    return (
        <Router>
            <Link className="clover-light" to={props.tagName} onClick={() => props.changeCurrentTag(props.tagName)}>{props.tagName}</Link>
        <Switch>
        <Route path="/:id" onClick={Child} />
        </Switch>
        </Router>
    );
}

export default Tags;
